import React, { Component } from "react";


class PlayBar extends Component {
    constructor(props) {
        super(props);
        // eslint-disable-next-line no-undef
        this.audio = new createRef()
    }

    render(){
        return(
            <div>
                <audio
                    ref={this.audio}
                    src={this.props.mp3Url}
                    style={{visibility: "hidden"}}
                ></audio>
                <div></div>
                <div></div>
            </div>
        )
    }
}

export  default PlayBar;
